import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, CardBody, CardTitle, CardText, Col, Row } from 'reactstrap';

export default function Resultado(props) {
    // Obtener el resultado según el contador


    return (
        <Row>
    <Col sm="6">
        {
            props.result.find(v => v.min < props.contador && v.max > props.contador) && (
                <Card className="my-2" style={{ width: '30rem' }}>
                    <CardBody>
                        <CardTitle tag="h5">Resultado</CardTitle>
                        <div>
                            {props.result.filter(v=> <CardText>Tipo de piel: {v.min < props.contador && v.max > props.contador}{v.tipo}</CardText>)}
                            <CardText>Tipo de piel: {props.result.fi(v => v.min < props.contador && v.max > props.contador).tipo}</CardText>
                            <CardText>Descripción: {props.result.filter(v => v.min < props.contador && v.max > props.contador).descripcion}</CardText>
                        </div>
                    </CardBody>
                </Card>
            )
        }
    </Col>
</Row>

    );
}
